#include "../include/LongNumberLib.h"
#include "../include/LongNumberLibTest.h"
#include <chrono>

int main(int argc, char *argv[]) {
	auto begin = std::chrono::steady_clock::now();
	LNL::LongInt result = LNL::LongInt("")*LNL::LongInt("12345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890");
	auto end = std::chrono::steady_clock::now();
	auto elapsedTime = std::chrono::duration_cast<std::chrono::milliseconds>(end - begin);
	std::cout << elapsedTime.count();
	// std::cout << "Time: " << elapsedTime.count() << "ms\n";
    return 0;
}
